  const expenses = [
    {
      id: "e1",
      title: "Ahmedabad",
      amount: "350000/-",
      date: new Date(2023, 1, 2),
    },

    {
      id: "e2",
      title: "Mumbai",
      amount: "400000/-",
      date: new Date(2023, 1, 4),
    },

    {
      id: "e1",
      title: "Surat",
      amount: "350000/-",
      date: new Date(2023, 1, 6),
    },

    {
      id: "e1",
      title: "Pune",
      amount: "400000/-",
      date: new Date(2023, 1, 8),
    },
  ];

  return (
    <div>
      <h1>BRAINVIRE INFOTECH</h1>

    </div>
  );
}

export default App;
